css:
@-webkit-keyframes flash {
  from {
    background: #6699cc;
  }
  to {
    background: none;
  }
}
.editor-colors {
  background-color: #191919;
  color: #a6a59d;
}
.editor .invisible-character,
.editor .indent-guide {
  color: rgba(116, 115, 105, 0.2);
}
.editor .gutter {
  background-color: #212121;
}
.editor .gutter .line-number {
  opacity: 0.5;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #d33682;
}
.editor .cursors.blink-off .cursor {
  visibility: visible !important;
  border-left: 1px solid #262626;
}
.editor .selection .region {
  background-color: rgba(220, 50, 47, 0.2);
}
.editor .line-number.cursor-line-no-selection {
  background-color: rgba(255, 255, 255, 0.07);
}
.bracket-matcher {
  background-color: #e8e6df;
  opacity: 0.2;
}
.comment {
  color: rgba(166, 165, 157, 0.5);
}
.entity {
  color: #f92672;
}
.keyword {
  color: #f92672;
  font-weight: bold;
}
.storage {
  color: #66d9ef;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #ae81ff;
}
.constant.numeric,
.constant.boolean {
  color: #ae81ff;
}
.variable {
  color: #fd971f;
}
.delimiter,
.brace {
  color: #a6a59d;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #e6db74;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
